import axios from "axios";

const CONCERTAPIBASEURL = "http://localhost:5020/api/profile";

class ProfileService {
  getProfile(username) {
    return axios.post(CONCERTAPIBASEURL + "/" + username);
  }
}

export default new ProfileService();
